import React, { Component } from 'react';

class brandlogo extends Component {
    render() {
        return (
            <div className="brandlogo" id="brandlogo">
                <div className="container"><img src="./../image/brand_logo.png" alt="" /></div>
            </div>
        );
    }
}

export default brandlogo;
